INSERT INTO `content` (`id`, `title`, `desc`, `topic`, `views`, `published`, `created_at`, `updated_at`) VALUES
(1, 'Rakercap 2 TKSCI Jogmatis', '<figure class=\"image\"><img style=\"aspect-ratio:823/459;\" src=\"data:image/jpeg;base64,\" width=\"823\" height=\"459\"></figure><p>Pada Hari Jum\'at tanggal 1 Desember 2023 telah dilaksanakan Rakercap 2 TKSCI Jogmatis yang dihadiri oleh penasehat, pengurus, member TKSCI Jogmatis beserta prospek sejumlah 86 member, bertempat di Rumah Om Aan (Penasehat TKSCI Jogmatis)</p><p>Dengan semangat dari seluruh member untuk bersepakat bahwa TKSCI Jogmatis kedepan akan menjadi komunitas yang berkembang, solid, bermanfaat bagi seluruh member, keluarga besar, dan seluruh warga masyarakat.</p><p>Agenda Rakercap kali ini membahas beberapa hal perencanaan kegiatan di tahun 2024, antara lain:</p><ol><li>Anniversary 9 th TKSCI Jogmatis</li><li>Jamnas ke 3 TKSCI Nusantara</li><li>Munas TKSCI Nusantara</li><li>AD/ART TKSCI Jogmatis</li></ol><p style=\"text-align:center;\"><img class=\"image_resized\" style=\"aspect-ratio:1280/960;width:67.98%;\" src=\"data:image/jpeg;base64,\" width=\"1280\" height=\"960\"></p>', 'Berita', 15, 1, '2023-12-14 05:47:07', '2023-12-18 03:41:26');
